textOriginal:
Boa tarde professor
A arma suja que Carlos Bolsonaro usa para enganar os evangélicos, agora, de alguma forma está se voltando contra eles;
Acharam que iam ficar espalhando fake news e não receber o troco, e se deram mal, pois o vídeo que o povo está espalhando da maçonaria contra eles é real,e atinge em cheio o evangélico convertido que estava sendo enganado;
Mas o mais importante no vídeo da maçonaria e que não vejo ninguém comentar:-"É a parte onde o grão-mestre fala que a democracia começou em 64,e exalta os anos da ditadura" e tendo ao seu lado o General Augusto Heleno na tribuna;
Logo bem se vê a intenção deles naquela reunião maçônica: "o de exaltar a ditadura".
Sucessos professor José
